/**
 * @param {string} s
 * @param {string} p
 * @return {number[]}
 */
var findAnagrams = function(s, p) {
    // const indexArray  = []
    // const sa = s.split('')
    // const sp = p.split('')
    // const sortedP =sp.sort().join('')
    // for(let i = 0 ; i + sp.length-1 < sa.length ;i++) {
    //     const tempStr = sa.slice(i,i+sp.length).sort().join('')
    //     if(tempStr === sortedP) {
    //         indexArray.push(i)
    //     }
    // }
    
    // 1. 首先把p用1个map存起来，记录下字符以及对应出现的次数
    // 2. s使用转为数组 维护一个双指针，左指针和右指针 第二个map，map长度固定 跟第一个map一致 ，每次移动左右指针，更新该map
    // 3. 右指针移动的条件为寻找包含p字串的右边界，找到之后移动左指针找最小，找到后再移动右指针，直到右指针不能再移动
    // 可以写一个判断两个map相等的工具函数

    // 优化：不用比对每个字母的个数（因为每次移动只变化一个字符），维护一个diff，map即可
    // 启动阶段：直接先把滑动窗口填充至need窗口的长度，然后比较两个map，生成一个diffMap 记录每个字母的差异值，负数为差的个数，正数为多的值，0代表刚刚好，每次移动维护该map，直到都变为0
    
    const indexArray = []
    const strToMap = (str) => {
        const map =  new Map()
        str.split('').forEach(e=>{
            if(map.has(e)) {
                map.set(e,map.get(e)+1)
            }else {
                map.set(e,1)
            }
        })
        return map
    }
    const windowMap = new Map()
    
    
    const isMapEqual = (diffMap) => {
        for (const [key,value] of diffMap) {
            if(value !== 0) {
                return false
            }
        }
        return  true
        // if(map1.size === map2.size) {
        //     for (const [key,v] of map1) {
        //         if(map2.has(key) && map2.get(key) === v) {
        //             continue
        //         }else {
        //             return false
        //         }
        //     }
        //     return true
        // }else {
        //     return false
        // }
    }
    
    
    const addToMapOrDelete = (char,map,isAdd=true) => {
        if(isAdd) {
            if(map.has(char)) {
                map.set(char,map.get(char)+1)
            }else {
                map.set(char,1)
            }
        }else {
            if(map.has(char)) {
                map.get(char) === 1 ? map.delete(char) : map.set(char,map.get(char)-1)
                
            }
        }   
    }
    const isMap1ContainMap2 = (map1,map2) => {
        if(map1.size < map2.size) {
            return false
        }
        let res = true
        for (const [key,value] of map2) {
            if(map1.has(key) && map1.get(key) >= value ) {
                continue
            }else {
                res = false
                break
            }
        }
        return res
    }
    const needMap = strToMap(p) // need compare
    
    // 冷启动阶段
    let leftIndex = rightIndex = 0
    while(windowMap.size < needMap.size) {
        addToMapOrDelete(s.charAt(rightIndex),windowMap)
        rightIndex++
    }
    const diffMap = new Map()
    needMap.forEach((v,k)=>{
        // if windowMap not has this value, add this value with minus
        // if windowMap has this value, use windowMap.get(k) minus v to get diff, the diff means :if the value is Larger than 0 , in later move , should delete this value 
        if(windowMap.has(k)) {
            diffMap.set(k,windowMap.get(k)-v)
        }
        else {
            diffMap.set(k,-v)
        }
    })
    
    for(; rightIndex < s.split('').length ; ) {
        if(isMapEqual(diffMap)) {
            indexArray.push(leftIndex)

            addToMapOrDelete(s.charAt(leftIndex),diffMap,false)
            leftIndex++
        }else {
            addToMapOrDelete(s.charAt(rightIndex),diffMap)
            rightIndex++
        }
        
        // const curStr = s.slice(leftIndex,rightIndex+1)
        // const curStrMap = strToMap(curStr)
        // if(leftIndex === 0 && rightIndex ===0) {
        //     windowMap.set(s[rightIndex],1)
        // }
        // while(windowMap.size < needMap.size) {
        //     rightIndex ++
        //     addToMapOrDelete(s.charAt(rightIndex),windowMap)
        // }
        // if(isMap1ContainMap2(windowMap,needMap)){
        //     if(isMapEqual(windowMap,needMap)) {
        //         indexArray.push(leftIndex)
        //     }
        //     addToMapOrDelete(s.charAt(leftIndex),windowMap,false)
        //     leftIndex++
            
        // }else {
        //     rightIndex++
        //     if(rightIndex < s.split('').length) {
        //         addToMapOrDelete(s.charAt(rightIndex),windowMap)
        //     }
        // }
    }    
    return indexArray
    
};

let s1 = 'cbaebabacd'
let p =   "abc"
let s2= 'abab'
let p2 = 'ab'
let s4 = 'baa'
let p4 = 'aa'
let s3 =""

let p3 = ""
let s5  = ""
let p5 = ""
